import React from 'react'
const Dashboardgh = (props) => {
    const history = useHistory();
    const [validator, showValidationMessage] = useValidator()
    const [loading, setLoading] = useState(false);
    const [user, setUser] = useState({
        email: "",
        password: ""
    })
    useEffect(() => {
        const storedData = JSON.parse(localStorage.getItem("MyUser"));
        if (storedData) {
            history.push("/");
        } else {
            history.push("/login");
        }
    }, [])  // eslint-disable-line react-hooks/exhaustive-deps
    const inputVal = (e) => {
        const { name, value } = e.target;
        setUser({
            ...user,
            [name]: value
        })
    }
    //axios.post("http://localhost:9001/user/login", user).then((res) => { })
    const loginUser = async (e) => {
        e.preventDefault();
        if (validator.allValid()) {
            setLoading(true);
            let res = await adminLogin(user);
            console.log(res);
            if (res.data.message === "Login Successfully") {
                alert(res.data.message)
                props.updateUserinlocalStorage(res.data.user);
                setLoading(false);
                history.push("/");
            } else {
                setLoading(false);
                alert(res.data.message)
            }
        } else {
            showValidationMessage(true);
        }
    }
    return (
        <>
            <div className="outsider">
                <div className="dashboard">
                    <h1>Group Head Page</h1>
                </div>
            </div>
        </>
    )
}
export default Dashboardgh;
